// Appbar stuff

const ffi = require('@lwahonen/ffi-napi');
const ref = require('@lwahonen/ref-napi');
const Struct = require('ref-struct-di')(ref);

const APPBARDATA = Struct({
    cbSize: ref.types.uint32,
    hWnd: ref.types.uint32,
    uCallbackMessage: ref.types.uint32,
    uEdge: ref.types.uint32,
    rc: Struct({
        left: ref.types.int32,
        top: ref.types.int32,
        right: ref.types.int32,
        bottom: ref.types.int32
    }),
    lParam: ref.types.int32 // This might need to be 'longlong' on 64-bit systems
});

const shell32 = ffi.Library('shell32.dll', {
    'SHAppBarMessage': ['int32', ['uint32', APPBARDATA]]
});

const user32 = new ffi.Library('user32', {
    'MoveWindow': ['bool', ['int32', 'uint32', 'uint32', 'uint32', 'uint32', 'bool']]
});

function ABSetPos(hWnd) {
    let appBarDataPos = new APPBARDATA();
    appBarDataPos.cbSize = APPBARDATA.size;
    appBarDataPos.hWnd = hWnd;
    appBarDataPos.uEdge = 1;
    appBarDataPos.rc.left = 0;
    appBarDataPos.rc.right = 1366;
    appBarDataPos.rc.top = 0;
    appBarDataPos.rc.bottom = 50;

    shell32.SHAppBarMessage(2 /* ABMsg_QUERYPOS */, appBarDataPos.ref());
    shell32.SHAppBarMessage(3 /* ABMsg_SETPOS */, appBarDataPos.ref());
    user32.MoveWindow(appBarDataPos.hWnd, appBarDataPos.rc.left, appBarDataPos.rc.top, appBarDataPos.rc.right - appBarDataPos.rc.left, appBarDataPos.rc.bottom - appBarDataPos.rc.top, true);
    let result = user32.MoveWindow(appBarDataPos.hWnd, appBarDataPos.rc.left, appBarDataPos.rc.top, appBarDataPos.rc.right - appBarDataPos.rc.left, appBarDataPos.rc.bottom - appBarDataPos.rc.top, true);
    console.log(result);
}

