vector < vector < int > > dp;

int get_ans(int x, int y){
    if(x <= 0) return 0;
    int& ret = dp[x][y];
    if(~ret) return ret;
    if(x < y) return 0;
    set < int > st;
    for(int i = 1; i <= x; i++){
        int end = i + y - 1;
        if(end > x) continue;
        st.insert(get_ans(i - 1, y) ^ get_ans(x - end, y));
    }
    ret = 0;
    while(st.count(ret)) ret++;
    return ret; 
}

void Solve(){
    int n, k;
    cin >> n >> k;
    dp = vector < vector < int > > (n + 1, vector < int > (k + 1, -1));
    cout << (get_ans(n, k) ? "Winning" : "Losing") << "\n";
}

