namespace define
{
    class jit_hook_c
    {
    private:
        uintptr_t m_original{ 0 };
        uint8_t old_instructions[ 12 ]{ };
        uint8_t new_instructions[ 12 ]{ };
    public:
        auto hook_fn( uintptr_t target_function, void* our_function ) -> const bool
        {
            unsigned char* _ptr = ( unsigned char* ) target_function;

            _ptr[ 0 ] = 0x48;
            _ptr[ 1 ] = 0xB8;
            *( void** ) ( _ptr + 2 ) = our_function;
            _ptr[ 10 ] = 0xFF;
            _ptr[ 11 ] = 0xE0;

            return true;
        }

        auto setup( uintptr_t target_function, void* our_function ) -> bool
        {
            memcpy( old_instructions, reinterpret_cast< void* >( target_function ), 12 );
            m_original = target_function;

            if ( !hook_fn( target_function, our_function ) )
                return false;

            memcpy( new_instructions, reinterpret_cast< void* >( target_function ), 12 );

            return true;
        }

        auto setup( const char* assembly_name, const char* name_space, const char* klass_name, const char* method_name, int param_count, void* our_function ) -> bool
        {
            auto jit_func_ptr = mono::method( assembly_name, name_space, klass_name, method_name, param_count );
            if ( !jit_func_ptr )
                return false;

            memcpy( old_instructions, reinterpret_cast< void* >( jit_func_ptr ), 12 );
            m_original = jit_func_ptr;

            if ( !hook_fn( jit_func_ptr, our_function ) )
                return false;

            memcpy( new_instructions, reinterpret_cast< void* >( jit_func_ptr ), 12 );

            return true;
        }

        bool toggle_hook( bool enabled )
        {
            if ( !m_original || !new_instructions )
                return false;

            auto jit_func_ptr = reinterpret_cast< uint8_t* >( m_original );
            auto instructions = enabled ? new_instructions : old_instructions;

            memcpy( jit_func_ptr, instructions, 12 );

            return true;
        }

        template<typename type>
        auto get_original( )
        {
            return reinterpret_cast< type >( m_original );
        }
    };
}
